SET FOREIGN_KEY_CHECKS=0;

CREATE DATABASE `buyme`
    CHARACTER SET 'latin1'
    COLLATE 'latin1_swedish_ci';

USE `buyme`;

#
# Structure for the `admin` table : 
#

CREATE TABLE `admin` (
  `id` int(11) NOT NULL auto_increment,
  `email` varchar(20) default NULL,
  `password` varchar(20) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;

#
# Structure for the `cart` table : 
#

CREATE TABLE `cart` (
  `email` varchar(50) default NULL,
  `productId` int(11) default NULL,
  `name` varchar(20) default NULL,
  `image` longtext,
  `price` int(11) default NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# Structure for the `product` table : 
#

CREATE TABLE `product` (
  `productId` int(11) NOT NULL auto_increment,
  `category` varchar(20) default NULL,
  `subcategory` varchar(20) default NULL,
  `productName` varchar(20) default NULL,
  `productCompany` varchar(20) default NULL,
  `productpricebd` int(11) default NULL,
  `productprice` int(11) default NULL,
  `productDescription` varchar(250) default NULL,
  `productShippingcharge` int(11) default NULL,
  `productAvailability` varchar(20) default NULL,
  `productimage1` longtext,
  PRIMARY KEY  (`productId`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=latin1;
#
# Structure for the `user` table : 
#

CREATE TABLE `user` (
  `userid` int(11) NOT NULL auto_increment,
  `fname` varchar(20) default NULL,
  `lname` varchar(20) default NULL,
  `address` varchar(30) default NULL,
  `city` varchar(20) default NULL,
  `state` varchar(20) default NULL,
  `zip` varchar(20) default NULL,
  `password` varchar(20) default NULL,
  `phone` varchar(20) default NULL,
  `email` varchar(50) default NULL,
  PRIMARY KEY  (`userid`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

